"277010":{"id":"277010","name":"Amor sem Idade","slug":"amor-sem-idade","original_title":"The Later Daters","overview":"Seis solteiros e solteiras maduros descobrem as dinâmicas dos relacionamentos modernos enquanto buscam o amor e redescobrem a si mesmos neste reality.","first_air_date":"2024-11-29","episode_run_time":0,"vote_average":4.7,"number_of_seasons":1,"number_of_episodes":8,"created_by":[],"production_companies":["Boardwalk Pictures","Higher Ground"],"genres":["Reality"],"certification":"12","backdrop_path":"https://image.tmdb.org/t/p/original/nLQoCEOjGtKDzFmoS25auHUACSl.jpg","poster_path":"https://image.tmdb.org/t/p/original/t2OeGc9iMsTdX1dnnb1tC3sdVLL.jpg","cast":["Logan Ury"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/9wHrltQGEqaKObKTX5FfOMYzoIJ.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/9wHrltQGEqaKObKTX5FfOMYzoIJ.jpg","air_date":"2024-11-29","episode_count":8,"overview":"N/A","vote_average":5.5,"episodes":{"1":{"name":"Ao amor!","overview":"Suzanne vai ao primeiro encontro às cegas de sua vida. Anise tenta não julgar George rápido demais. Nate é todo certinho, mas tenta afrouxar suas regras.","air_date":"2024-11-29","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/nMptBbUQ1aBJajpvc91QV0gnQGs.jpg","vote_average":5},"2":{"name":"Você está sem limites","overview":"Pam tem que largar o passado e pensar no futuro. Dwayna fica chocada ao saber das coisas que George falou. Logan aconselha Suzanne a largar sua cartilha ultrapassada.","air_date":"2024-11-29","runtime":40,"still_path":"https://image.tmdb.org/t/p/original/Zokm6ZYh01yPHdJ71pEHg8pDcZ.jpg","vote_average":6},"3":{"name":"Seja interessada, não interessante","overview":"Nate fica pensativo sobre a diferença de idade. Lori tem que dar um jeito de sair da área da amizade. Pam precisa dar espaço para as pessoas falarem.","air_date":"2024-11-29","runtime":40,"still_path":"https://image.tmdb.org/t/p/original/mQlxrcP8hCKQ7t3xEitqrrMDEaE.jpg","vote_average":0},"4":{"name":"Gostei do jeito dele","overview":"O encontro de Anise faz ela mudar sua perspectiva. Nate explica para Lisa como se lesionou. Lori deixa Ty aos seus pés, mas não consegue se lembrar de onde conhece ele.","air_date":"2024-11-29","runtime":41,"still_path":"https://image.tmdb.org/t/p/original/dSeRTR92KVU4X8u58qgq7pRowaH.jpg","vote_average":0},"5":{"name":"Dwayna sabe das coisas","overview":"Jackie e Nate falam sobre seu relacionamento. Dwayna escolhe o próximo encontro de Anise. Logan aborda a diferença entre impeditivos e pequenos incômodos com Suzanne.","air_date":"2024-11-29","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/XJlG0pJZU7Pp4oc6DFrG8lMHdI.jpg","vote_average":0},"6":{"name":"Me arrepia toda","overview":"Anise está nos céus depois de um encontro ótimo. Logan aconselha Greg a ir além das aparências. Lori pensa em convidar Martin para sua festa.","air_date":"2024-11-29","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/314dCSlNHCqdXFKXqWA5UpePnjH.jpg","vote_average":0},"7":{"name":"Entenderam?","overview":"Nate precisa fazer uma escolha. Suzanne percebe que precisa de mais estabilidade. Greg se arrepende da decisão que tomou.","air_date":"2024-11-29","runtime":40,"still_path":"https://image.tmdb.org/t/p/original/cdOO1PZggbDvQxvFznXWqVJYBqV.jpg","vote_average":0},"8":{"name":"Um pequeno momento","overview":"A experiência chega ao fim, e os participantes se encontram para discutir como ela mudou suas vidas. E contam tudinho sobre seus relacionamentos e novos pretendentes.","air_date":"2024-11-29","runtime":35,"still_path":"https://image.tmdb.org/t/p/original/uhDXbqFaZh77uNOatnlzT0t19uP.jpg","vote_average":0}}}}},
