"209648":{"id":"209648","name":"Que Chegue a Você: Kimi ni Todoke","slug":"que-chegue-a-voce-kimi-ni-todoke","original_title":"君に届け","overview":"Sawako parece meio sombria e tem dificuldade de se enturmar na escola. Mas a situação começa a mudar quando um colega extrovertido se aproxima dela.","first_air_date":"2023-03-30","episode_run_time":34,"vote_average":7.6,"number_of_seasons":1,"number_of_episodes":12,"created_by":[],"production_companies":["TV Tokyo","FINE Entertainment"],"genres":["Drama"],"certification":"12","backdrop_path":"https://image.tmdb.org/t/p/original/dDCBtiHEm8HnqP1Lx9q2kg2CZ1o.jpg","poster_path":"https://image.tmdb.org/t/p/original/3fDCXoFMKdCW54CjJePUmtDA4CJ.jpg","cast":["南沙良","鈴鹿央士","櫻井海音","久間田琳加","中村里帆"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/3fDCXoFMKdCW54CjJePUmtDA4CJ.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/3fDCXoFMKdCW54CjJePUmtDA4CJ.jpg","air_date":"2023-03-30","episode_count":12,"overview":"N/A","vote_average":4.3,"episodes":{"1":{"name":"Novos sentimentos","overview":"Sawako sempre foi tímida e nunca conseguiu fazer amigos na escola. Seu sonho é ser uma pessoa mais extrovertida, como seu colega de classe, Kazehaya.","air_date":"2023-03-30","runtime":34,"still_path":"https://image.tmdb.org/t/p/original/ao9k3tYeXC24hveuidbSadRrahe.jpg","vote_average":0},"2":{"name":"Boatos","overview":"O sorteio dos novos lugares da turma é realizado e Sawako teme ficar isolada novamente. Mas Kazehaya toma uma atitude inesperada.","air_date":"2023-03-30","runtime":34,"still_path":"https://image.tmdb.org/t/p/original/h9oJaQ3NTdimcEOKdkrBmyz4SNe.jpg","vote_average":0},"3":{"name":"Sentimentos","overview":"Sawako fica amiga de Kurumi, uma garota muito bonita. Mas Kurumi tem um passado com Kazehaya e pode estar escondendo suas verdadeiras intenções.","air_date":"2023-03-30","runtime":34,"still_path":"https://image.tmdb.org/t/p/original/pcH2kVyqUEYDhLdJWj9Gg0R4lBk.jpg","vote_average":0},"4":{"name":"Amor e sonhos","overview":"Chizuru procura um presente de aniversário para Ryu, de quem é muito próxima. Mas ela guarda segredos sobre seus verdadeiros sentimentos amorosos.","air_date":"2023-03-30","runtime":34,"still_path":"https://image.tmdb.org/t/p/original/b59fpkHmO3u9IawDhU0rstLkdxw.jpg","vote_average":0},"5":{"name":"Natal com amigos","overview":"O Natal está chegando e Sawako está animada para ir à festa, mas seus pais querem celebrar a data com ela.","air_date":"2023-03-30","runtime":34,"still_path":"https://image.tmdb.org/t/p/original/4aA8Of9BUkWHMtSn2t8uHZpx8GP.jpg","vote_average":0},"6":{"name":"Dia dos Namorados","overview":"No Dia dos Namorados, Sawako leva vários chocolates para a escola. Ela quer presentear Kazehaya, mas seu nervosismo a impede.","air_date":"2023-03-30","runtime":34,"still_path":"https://image.tmdb.org/t/p/original/yFKQnKvM6fQAdN6N8CpLP4l1ar1.jpg","vote_average":0},"7":{"name":"Festival da escola","overview":"Preocupadas, Ayane e Chizuru saem para procurar Sawako. Escondida, ela está arrasada com as palavras de Kazehaya.","air_date":"2023-03-30","runtime":34,"still_path":"https://image.tmdb.org/t/p/original/efWDjc7Rqmgw9unakGqSeepv7EW.jpg","vote_average":0},"8":{"name":"Primeiro beijo","overview":"Tudo está indo às mil maravilhas para Sawako e Kazehaya. Chizuru descobre que Ryu está a fim de alguém.","air_date":"2023-03-30","runtime":34,"still_path":"https://image.tmdb.org/t/p/original/nN9BFxYo0MBp5zYBEwtJHhlqyUi.jpg","vote_average":0},"9":{"name":"Laços","overview":"Enquanto planejam o futuro, Kazehaya revela seu desejo de assumir o negócio da família. O problema é que seu pai não apoia a ideia.","air_date":"2023-03-30","runtime":34,"still_path":"https://image.tmdb.org/t/p/original/84oEpbHwX6xR2szzAklcC076Mes.jpg","vote_average":0},"10":{"name":"O caminho a seguir","overview":"Ao descobrir que Sawako também quer ser professora, Kurumi coloca o orgulho de lado e pede ajuda a ela.","air_date":"2023-03-30","runtime":34,"still_path":"https://image.tmdb.org/t/p/original/dyJl5k9FQaSYNv8p2mncWsjy4oJ.jpg","vote_average":4.3},"11":{"name":"Aprendizados","overview":"Kazehaya se esforça para convencer o pai de sua vocação para treinador. Sawako considera se candidatar à Universidade de Educação de Sapporo.","air_date":"2023-03-30","runtime":34,"still_path":"https://image.tmdb.org/t/p/original/v4BsLAmySb7XPIrq19100ovkfUC.jpg","vote_average":0},"12":{"name":"Despedidas","overview":"O dia da formatura finalmente chega. Sawako e Kurumi recebem seus resultados de admissão na universidade e todos partem em busca de seus sonhos.","air_date":"2023-03-30","runtime":35,"still_path":"https://image.tmdb.org/t/p/original/qWytkX79GHcd4Kx6j60UgL7nHUz.jpg","vote_average":0}}}}},
